https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%9D%D0%BE%D0%B2%D0%B8\" class=\"mw-redirect\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041d\u043e\u0432\u0438\">\u0411\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u041d\u043e\u0432\u0438<\/a>.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XIX_%D0%B2%D0%B5%D0%BA\" title=\"XIX \u0432\u0435\u043a\">XIX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1804_%D0%B3%D0%BE%D0%B4\" title=\"1804 \u0433\u043e\u0434\">1804<\/a>&#160;\u2014 \u0432 \u0434\u0435\u043d\u044c, \u043a\u043e\u0433\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0443<\/a> \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u043b\u043e\u0441\u044c 35 \u043b\u0435\u0442, \u0432 \u0435\u0433\u043e \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0438\u0435 \u0411\u0443\u043b\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043b\u0430\u0433\u0435\u0440\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1808_%D0%B3%D0%BE%D0%B4\" title=\"1808 \u0433\u043e\u0434\">1808<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u0430\u043b\u0438\u043b\u0430\u0441\u044c \u043f\u043e\u043f\u044b\u0442\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0438 \u04