u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%82%D0%B0%D0%B2%D0%B0\" title=\"\u041e\u0442\u0442\u0430\u0432\u0430\">\u041e\u0442\u0442\u0430\u0432\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1877_%D0%B3%D0%BE%D0%B4\" title=\"1877 \u0433\u043e\u0434\">1877<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D0%B8%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%90%D0%BB%D0%B2%D0%B0\" title=\"\u042d\u0434\u0438\u0441\u043e\u043d, \u0422\u043e\u043c\u0430\u0441 \u0410\u043b\u0432\u0430\">\u0422\u043e\u043c\u0430\u0441 \u042d\u0434\u0438\u0441\u043e\u043d<\/a> \u0432 \u043f\u0438\u0441\u044c\u043c\u0435 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0443 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u043d\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%82%D1%82%D1%81%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041f\u0438\u0442\u0442\u0441\u0431\u0443\u0440\u0433\">\u041f\u0438\u0442\u0442\u0441\u0431\u0443\u0440\u0433\u0430<\/a> \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0438\u043b \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043f\u0440\u0438\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u044f \u043f\u0440\u0438 \u043e\u0431\u0449\u0435\u043d\u0438\u0438 \u043f\u043e \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u0443 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0441\u043b\u043e\u0432\u043e \u00abhello\u00bb (\u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043e\u043d\u043e \u0442\u0440\u0430\u043d\u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u043e\u0441\u044c \u0432 \u00ab\u0430\u043b\u043b\u043e\u00bb). \u0412 \u044d\u0442\u043e\u0442 \u0436\u0435 \u0434\u0435\u043d\u044c \u042d\u0434\u0438\u0441\u043e\u043d \u043f\u0440\u043e\u0438\u0437\u0432\u0451\u043b \u043f\u0435\u0440\u0432\u0443\u044e \u0432 \u043c\u0438\u0440\u0435 \u0437\u0430\u043f\u0438\u0441\u044c \u0437\u0432\u0443\u043a\u0430&#160;\u2014 \u0431\u044b\u043b\u0430 \u0437\u0430\u043f\u0438\u0441\u0430\u043d\u0430 \u043f\u0435\u0441\u043d\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Mary_Had_a_Little_Lamb\" title=\"Mary Had a Little Lamb\">Mary Had a Little Lamb<\/a>\u00bb (\u00ab\u0423 \u041c\u044d\u0440\u0438 \u0431\u044b\u043b \u0431\u0430\u0440\u0430\u0448\u0435\u043a\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887_%D0%B3%D0%BE%D0%B4\" title=\"1887 \u0433\u043e\u0434\">1887<\/a>&#160;\u2014 \u043f\u0440\u043e\u0442\u0435\u0441\u0442 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u0438\u0437\u0431\u0440\u0430\u043d\u0438\u044f \u0432 \u0438\u044e\u043b\u0435 \u0431\u043e\u043b\u0433\u0430\u0440\u0441\u043a\u0438\u043c \u043a\u043d\u044f\u0437\u0435\u043c \u043f\u0440\u0438\u043d\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4_I_(%D1%86%D0%B0%D1%80%D1%8C_%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D0%B8)\" title=\"\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 I (\u0446\u0430\u0440\u044c \u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438)\">\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\u0430 \u0421\u0430\u043a\u0441\u0435\u043d-\u041a\u043e\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888<\/a>&#160;\u2014 \u0448\u0435\u0441\u0442\u0435\u0440\u043e \u043d\u043e\u0440\u0432\u0435\u0436\u0446\u0435\u0432 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BD%D1%81%D0%B5%D0%BD,_%D0%A4%D1%80%D0%B8%D1%82%D1%8C%D0%BE%D1%84\" title=\"\u041d\u0430\u043d\u0441\u0435\u043d, \u0424\u0440\u0438\u0442\u044c\u043e\u0444\">\u0424\u0440\u0438\u0442\u044c\u043e\u0444\u043e\u043c \u041d\u0430\u043d\u0441\u0435\u043d\u043e\u043c<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0438\u0441\u044c \u0432 \u043b\u044b\u0436\u043d\u044b\u0439 \u043f\u043e\u0445\u043e\u0434 \u0441 \u0446\u0435\u043b\u044c\u044e \u043f\u0435\u0440\u0435\u0441\u0435\u0447\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D0%BD%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u043d\u043b\u0430\u043d\u0434\u0438\u044f\">\u0413\u0440\u0435\u043d\u043b\u0430\u043d\u0434\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0430\u0440\u0431\u0438\u0442\u0440\u0430\u0436 \u043e\u0431\u044f\u0437\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0432\u044b\u043f\u043b\u0430\u0442\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a> \u0448\u0442\u0440\u0430\u0444 \u0432 \u0440\u0430\u0437\u043c\u0435\u0440\u0435 478 \u0442\u044b\u0441. \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432 \u0437\u0430 \u043b\u043e\u0432\u043b\u044e \u0440\u044b\u0431\u044b \u0432 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0445 \u0432\u043e\u0434\u0430\u0445.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XX_%D0%B2%D0%B5%D0%BA\" title=\"XX \u0432\u0435\u043a\">XX \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908_%D0%B3%D0%BE%D0%B4\" title=\"1908 \u0433\u043e\u0434\">1908<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D1%89%D0%B8%D0%BD%D0%B0\" title=\"\u0416\u0435\u043d\u0449\u0438\u043d\u0430\">\u0436\u0435\u043d\u0449\u0438\u043d\u0430\u043c<\/a> \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u043e \u043f\u043e\u0441\u0442\u0443\u043f\u0430\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%B7\" class=\"mw-redirect\" title=\"\u0412\u0443\u0437\">\u0432\u0443\u0437\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u043f\u0440\u043e\u0445\u043e\u0434 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0441\u0443\u0434\u043d\u0430 \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BD%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b\">\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b<\/a> (\u041e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u043a\u0430\u043d\u0430\u043b\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c \u043b\u0438\u0448\u044c 12 \u0438\u044e\u043d\u044f 1920 \u0433\u043e\u0434\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410