1\u0442\u0438\u0432\u0430\u043b\u044c)\">\u0412\u0443\u0434\u0441\u0442\u043e\u043a\u0441\u043a\u0438\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c<\/a>&#160;\u2014 \u043a\u043e\u043d\u0435\u0446 \u044d\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B8%D0%BF%D0%BF%D0%B8\" title=\"\u0425\u0438\u043f\u043f\u0438\">\u0445\u0438\u043f\u043f\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1971_%D0%B3%D0%BE%D0%B4\" title=\"1971 \u0433\u043e\u0434\">1971<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D1%81%D0%BE%D0%BD,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4\" title=\"\u041d\u0438\u043a\u0441\u043e\u043d, \u0420\u0438\u0447\u0430\u0440\u0434\">\u0420\u0438\u0447\u0430\u0440\u0434 \u041d\u0438\u043a\u0441\u043e\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BB%D0%BB%D0%B0%D1%80_%D0%A1%D0%A8%D0%90\" title=\"\u0414\u043e\u043b\u043b\u0430\u0440 \u0421\u0428\u0410\">\u0434\u043e\u043b\u043b\u0430\u0440\u0430 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\">\u0437\u043e\u043b\u043e\u0442\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%84%D0%B8%D0%BE%D0%BF%D0%B8%D1%8F\" title=\"\u042d\u0444\u0438\u043e\u043f\u0438\u044f\">\u042d\u0444\u0438\u043e\u043f\u0438\