80<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0432\u044b\u0448\u043b\u0430 \u0430\u0432\u0442\u043e\u0431\u0438\u043e\u0433\u0440\u0430\u0444\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%80%D0%B8%D1%81%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6\" title=\"\u0425\u0430\u0440\u0440\u0438\u0441\u043e\u043d, \u0414\u0436\u043e\u0440\u0434\u0436\">\u0414\u0436\u043e\u0440\u0434\u0436\u0430 \u0425\u0430\u0440\u0440\u0438\u0441\u043e\u043d\u0430<\/a> (George Harrison) \u00abI Me Mine\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a><ul><li>\u0411\u044e\u0440\u043e \u043f\u0440\u0435\u0437\u0438\u0434\u0438\u0443\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%82%D1%80%D0%BE%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B8%D1%8F_%D0%9A%D0%9F%D0%A1%D0%A1\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u044f \u041a\u041f\u0421\u0421\">\u0426\u041a\u041a \u041a\u041f\u0421\u0421<\/a>, \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u0432 \u0432\u043e\u043f\u0440\u043e\u0441 \u043e \u0440\u044f\u0434\u0435 \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0439 \u0431\u044b\u0432\u0448\u0435\u0433\u043e \u0447\u043b\u0435\u043d\u0430 \u041f\u043e\u043b\u0438\u0442\u0431\u044e\u0440\u043e, \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f \u0426\u041a \u041a\u041f\u0421\u0421 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u042f\u043a\u043e\u0432\u043b\u0435\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0410.&#160;\u041d.&#160;\u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0430<\/a>, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0445 \u043d\u0430 \u0440\u0430\u0441\u043a\u043e\u043b \u041a\u041f\u0421\u0421 \u0438 \u0443\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0435\u0451 \u0441 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0430\u0440\u0435\u043d\u044b, \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b\u043e: \u0437\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0440\u0435\u0447\u0430\u0449\u0438\u0435 \u0423\u0441\u0442\u0430\u0432\u0443 \u041a\u041f\u0421\u0421 \u0438 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0435 \u043d\u0430 \u0440\u0430\u0441\u043a\u043e\u043b \u043f\u0430\u0440\u0442\u0438\u0438, \u0441\u0447\u0438\u0442\u0430\u0442\u044c \u043d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u044b\u043c \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u0435 \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043d\u0438\u0435 \u0447\u043b\u0435\u043d\u0430 \u041a\u041f\u0421\u0421 \u0410.&#160;\u041d.&#160;\u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0430 \u0432 \u0440\u044f\u0434\u0430\u0445 \u041a\u041f\u0421\u0421. \u041f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043f\u043e \u044d\u0442\u043e\u043c\u0443 \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u0431\u044b\u043b\u043e \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043e \u0432 \u043f\u0435\u0440\u0432\u0438\u0447\u043d\u0443\u044e \u043f\u0430\u0440\u0442\u0438\u0439\u043d\u0443\u044e \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044e.<\/li><li>\u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430